import React from "react";
import "./Styles/Table.css";

export const Table = () => {
  return (
    <div className="main">
      <div className="above-table">
        <p className="intro">
          <b>Resources for Multilingual Learners</b> include unit- and
          selection-specific supports as well as the following components that
          you may use flexibly with any text.
        </p>
      </div>
    </div>
  );
};
